var profilePage={init:function(){this.headerFadeIn(),this.headerHr()},headerFadeIn:function(){var e=$(".header-title"),a="Chengkai Wang".split(""),i="";for(n=0;n<a.length;n++)i+='<span class="opacity0">'+a[n]+"</span>";var n=0;e.html(i).find("span").each(function(){var e=$(this);setTimeout(function(){e.addClass("fade-in")},200*n),n++})},headerHr:function(){$(".header-hr").velocity({width:["100%","0"]},{duration:2e3,delay:4e3,easing:[250,15]})}};profilePage.init();